import React, { useState } from 'react';
import { Anomaly } from '../types/insights';
import { AlertTriangle, TrendingUp, GitBranch, Zap, ChevronDown, ChevronRight, Filter, Search } from 'lucide-react';

interface AnomaliesTableProps {
  anomalies: Anomaly[];
}

const AnomaliesTable: React.FC<AnomaliesTableProps> = ({ anomalies }) => {
  const [expandedRows, setExpandedRows] = useState<Set<string>>(new Set());
  const [filterSeverity, setFilterSeverity] = useState<string>('all');
  const [filterType, setFilterType] = useState<string>('all');
  const [searchQuery, setSearchQuery] = useState<string>('');

  const toggleRow = (id: string) => {
    const newExpanded = new Set(expandedRows);
    if (newExpanded.has(id)) {
      newExpanded.delete(id);
    } else {
      newExpanded.add(id);
    }
    setExpandedRows(newExpanded);
  };

  const getSeverityColor = (severity: string) => {
    switch (severity) {
      case 'critical': return 'badge-error';
      case 'high': return 'badge-warning';
      case 'medium': return 'badge-primary';
      case 'low': return 'badge-success';
      default: return 'badge-neutral';
    }
  };

  const getTypeIcon = (type: string) => {
    switch (type) {
      case 'burst_correlation': return <Zap className="h-4 w-4" />;
      case 'lead_lag': return <TrendingUp className="h-4 w-4" />;
      case 'pmi_correlation': return <GitBranch className="h-4 w-4" />;
      case 'change_attribution': return <AlertTriangle className="h-4 w-4" />;
      default: return <AlertTriangle className="h-4 w-4" />;
    }
  };

  const getTypeColor = (type: string) => {
    switch (type) {
      case 'burst_correlation': return 'text-primary-600';
      case 'lead_lag': return 'text-success-600';
      case 'pmi_correlation': return 'text-secondary-600';
      case 'change_attribution': return 'text-accent-600';
      default: return 'text-neutral-600';
    }
  };

  const formatTypeLabel = (type: string) => {
    switch (type) {
      case 'burst_correlation': return 'Burst Correlation';
      case 'lead_lag': return 'Lead-Lag';
      case 'pmi_correlation': return 'PMI Co-occurrence';
      case 'change_attribution': return 'Change Attribution';
      default: return type;
    }
  };

  const filteredAnomalies = anomalies.filter(anomaly => {
    const severityMatch = filterSeverity === 'all' || anomaly.severity === filterSeverity;
    const typeMatch = filterType === 'all' || anomaly.type === filterType;
    const searchMatch = searchQuery === '' || 
      anomaly.message.toLowerCase().includes(searchQuery.toLowerCase()) ||
      anomaly.id.toLowerCase().includes(searchQuery.toLowerCase());
    return severityMatch && typeMatch && searchMatch;
  });

  const renderDetails = (anomaly: Anomaly) => {
    const details = anomaly.details;

    switch (anomaly.type) {
      case 'burst_correlation':
        return (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="space-y-4">
              <div className="flex justify-between items-center py-2 border-b border-neutral-100">
                <span className="font-medium text-neutral-700">Correlation:</span>
                <span className="font-mono text-lg font-bold">{details.correlation?.toFixed(3)}</span>
              </div>
              <div className="flex justify-between items-center py-2 border-b border-neutral-100">
                <span className="font-medium text-neutral-700">P-value:</span>
                <span className="font-mono text-lg font-bold">{details.p_value?.toExponential(2)}</span>
              </div>
              <div className="flex justify-between items-center py-2">
                <span className="font-medium text-neutral-700">Aligned Bursts:</span>
                <span className="font-mono text-lg font-bold">{details.aligned_bursts}</span>
              </div>
            </div>
            <div className="space-y-4">
              <div className="flex justify-between items-center py-2 border-b border-neutral-100">
                <span className="font-medium text-neutral-700">Sample Size:</span>
                <span className="font-mono text-lg font-bold">{details.sample_size}</span>
              </div>
              <div className="flex justify-between items-center py-2 border-b border-neutral-100">
                <span className="font-medium text-neutral-700">Total Buckets:</span>
                <span className="font-mono text-lg font-bold">{details.total_buckets}</span>
              </div>
              <div className="flex justify-between items-center py-2">
                <span className="font-medium text-neutral-700">Confidence Interval:</span>
                <span className="font-mono text-sm">
                  [{details.confidence_interval?.[0]?.toFixed(3)}, {details.confidence_interval?.[1]?.toFixed(3)}]
                </span>
              </div>
            </div>
          </div>
        );

      case 'lead_lag':
        return (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="space-y-4">
              <div className="flex justify-between items-center py-2 border-b border-neutral-100">
                <span className="font-medium text-neutral-700">Lag:</span>
                <span className="font-mono text-lg font-bold">{details.lag_seconds}s</span>
              </div>
              <div className="flex justify-between items-center py-2 border-b border-neutral-100">
                <span className="font-medium text-neutral-700">Direction:</span>
                <span className="font-mono text-lg font-bold">{details.direction}</span>
              </div>
              <div className="flex justify-between items-center py-2">
                <span className="font-medium text-neutral-700">Correlation:</span>
                <span className="font-mono text-lg font-bold">{details.correlation?.toFixed(3)}</span>
              </div>
            </div>
            <div className="space-y-4">
              <div className="flex justify-between items-center py-2 border-b border-neutral-100">
                <span className="font-medium text-neutral-700">Granger Score:</span>
                <span className="font-mono text-lg font-bold">{details.granger_score?.toFixed(3)}</span>
              </div>
              <div className="flex justify-between items-center py-2 border-b border-neutral-100">
                <span className="font-medium text-neutral-700">Confidence:</span>
                <span className="font-mono text-lg font-bold">{details.confidence?.toFixed(3)}</span>
              </div>
            </div>
          </div>
        );

      case 'pmi_correlation':
        return (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="space-y-4">
              <div className="flex justify-between items-center py-2 border-b border-neutral-100">
                <span className="font-medium text-neutral-700">PMI Score:</span>
                <span className="font-mono text-lg font-bold">{details.pmi_score?.toFixed(2)}</span>
              </div>
              <div className="flex justify-between items-center py-2 border-b border-neutral-100">
                <span className="font-medium text-neutral-700">Support:</span>
                <span className="font-mono text-lg font-bold">{details.support}</span>
              </div>
              <div className="flex justify-between items-center py-2">
                <span className="font-medium text-neutral-700">Confidence:</span>
                <span className="font-mono text-lg font-bold">{details.confidence?.toFixed(3)}</span>
              </div>
            </div>
            <div className="space-y-4">
              <div className="flex justify-between items-center py-2 border-b border-neutral-100">
                <span className="font-medium text-neutral-700">Total Buckets:</span>
                <span className="font-mono text-lg font-bold">{details.total_buckets}</span>
              </div>
            </div>
          </div>
        );

      case 'change_attribution':
        return (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="space-y-4">
              <div className="flex justify-between items-center py-2 border-b border-neutral-100">
                <span className="font-medium text-neutral-700">Correlation:</span>
                <span className="font-mono text-lg font-bold">{details.correlation_coefficient?.toFixed(3)}</span>
              </div>
              <div className="flex justify-between items-center py-2 border-b border-neutral-100">
                <span className="font-medium text-neutral-700">Lag:</span>
                <span className="font-mono text-lg font-bold">{details.lag_minutes?.toFixed(1)} min</span>
              </div>
              <div className="flex justify-between items-center py-2">
                <span className="font-medium text-neutral-700">Change Count:</span>
                <span className="font-mono text-lg font-bold">{details.change_count}</span>
              </div>
            </div>
            <div className="space-y-4">
              <div className="flex justify-between items-center py-2 border-b border-neutral-100">
                <span className="font-medium text-neutral-700">Effect Count:</span>
                <span className="font-mono text-lg font-bold">{details.effect_count}</span>
              </div>
            </div>
          </div>
        );

      default:
        return (
          <div className="bg-neutral-50 rounded-lg p-4">
            <pre className="text-sm text-neutral-700 overflow-auto">
              {JSON.stringify(details, null, 2)}
            </pre>
          </div>
        );
    }
  };

  return (
    <div className="space-y-6">
      {/* Filters and Search */}
      <div className="card">
        <div className="card-header">
          <div className="flex items-center gap-2">
            <Filter className="w-5 h-5 text-neutral-600" />
            <h3 className="card-title">Filter Anomalies</h3>
          </div>
          <div className="text-sm text-neutral-500">
            {filteredAnomalies.length} of {anomalies.length} anomalies
          </div>
        </div>
        <div className="card-content">
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            <div>
              <label className="block text-sm font-medium text-neutral-700 mb-2">Search</label>
              <div className="relative">
                <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 w-4 h-4 text-neutral-400" />
                <input
                  type="text"
                  placeholder="Search anomalies..."
                  value={searchQuery}
                  onChange={(e) => setSearchQuery(e.target.value)}
                  className="w-full pl-10 pr-4 py-2 border border-neutral-300 rounded-lg text-sm focus:outline-none focus:ring-2 focus:ring-primary-500 focus:border-transparent"
                />
              </div>
            </div>

            <div>
              <label className="block text-sm font-medium text-neutral-700 mb-2">Severity Level</label>
              <select
                value={filterSeverity}
                onChange={(e) => setFilterSeverity(e.target.value)}
                className="w-full px-3 py-2 border border-neutral-300 rounded-lg text-sm focus:outline-none focus:ring-2 focus:ring-primary-500 focus:border-transparent"
              >
                <option value="all">All Severities</option>
                <option value="critical">Critical</option>
                <option value="high">High</option>
                <option value="medium">Medium</option>
                <option value="low">Low</option>
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-neutral-700 mb-2">Anomaly Type</label>
              <select
                value={filterType}
                onChange={(e) => setFilterType(e.target.value)}
                className="w-full px-3 py-2 border border-neutral-300 rounded-lg text-sm focus:outline-none focus:ring-2 focus:ring-primary-500 focus:border-transparent"
              >
                <option value="all">All Types</option>
                <option value="burst_correlation">Burst Correlation</option>
                <option value="lead_lag">Lead-Lag</option>
                <option value="pmi_correlation">PMI Co-occurrence</option>
                <option value="change_attribution">Change Attribution</option>
              </select>
            </div>
          </div>
        </div>
      </div>

      {/* Table */}
      <div className="table-container">
        <table className="table">
          <thead>
            <tr>
              <th className="px-6 py-4 text-left text-xs font-semibold text-neutral-600 uppercase tracking-wider">
                Anomaly Details
              </th>
              <th className="px-6 py-4 text-left text-xs font-semibold text-neutral-600 uppercase tracking-wider">
                Type
              </th>
              <th className="px-6 py-4 text-left text-xs font-semibold text-neutral-600 uppercase tracking-wider">
                Severity
              </th>
              <th className="px-6 py-4 text-left text-xs font-semibold text-neutral-600 uppercase tracking-wider">
                Detected
              </th>
              <th className="px-6 py-4 text-left text-xs font-semibold text-neutral-600 uppercase tracking-wider">
                Actions
              </th>
            </tr>
          </thead>
          <tbody>
            {filteredAnomalies.map((anomaly, index) => (
              <React.Fragment key={anomaly.id}>
                <tr className="hover:bg-neutral-50 transition-colors">
                  <td className="px-6 py-4">
                    <div className="flex items-start space-x-3">
                      <div className="flex-shrink-0 mt-1">
                        <AlertTriangle className="h-5 w-5 text-error-500" />
                      </div>
                      <div className="min-w-0 flex-1">
                        <div className="text-sm font-medium text-neutral-900 mb-1">
                          {anomaly.message}
                        </div>
                        <div className="text-xs text-neutral-500">
                          ID: {anomaly.id}
                        </div>
                      </div>
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <div className={`flex items-center space-x-2 ${getTypeColor(anomaly.type)}`}>
                      {getTypeIcon(anomaly.type)}
                      <span className="text-sm font-medium">
                        {formatTypeLabel(anomaly.type)}
                      </span>
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <span className={`badge ${getSeverityColor(anomaly.severity)}`}>
                      {anomaly.severity.toUpperCase()}
                    </span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <div className="text-sm text-neutral-900">
                      {new Date(anomaly.timestamp).toLocaleTimeString()}
                    </div>
                    <div className="text-xs text-neutral-500">
                      {new Date(anomaly.timestamp).toLocaleDateString()}
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <button
                      onClick={() => toggleRow(anomaly.id)}
                      className="btn btn-secondary text-sm"
                    >
                      {expandedRows.has(anomaly.id) ? (
                        <>
                          <ChevronDown className="h-4 w-4 mr-1" />
                          Hide Details
                        </>
                      ) : (
                        <>
                          <ChevronRight className="h-4 w-4 mr-1" />
                          View Details
                        </>
                      )}
                    </button>
                  </td>
                </tr>
                {expandedRows.has(anomaly.id) && (
                  <tr className="bg-neutral-50">
                    <td colSpan={5} className="px-6 py-6">
                      <div className="bg-white rounded-lg p-6 border border-neutral-200">
                        <h4 className="text-sm font-semibold text-neutral-900 mb-4">Technical Details</h4>
                        {renderDetails(anomaly)}
                      </div>
                    </td>
                  </tr>
                )}
              </React.Fragment>
            ))}
          </tbody>
        </table>

        {filteredAnomalies.length === 0 && (
          <div className="text-center py-12">
            <div className="w-16 h-16 bg-neutral-100 rounded-full flex items-center justify-center mx-auto mb-4">
              <AlertTriangle className="h-8 w-8 text-neutral-400" />
            </div>
            <h3 className="text-lg font-medium text-neutral-900 mb-2">No Anomalies Found</h3>
            <p className="text-neutral-500">
              No anomalies match the current filter criteria.
            </p>
          </div>
        )}
      </div>
    </div>
  );
};

export default AnomaliesTable;
